message:
Sobre quem se diz cristão e declara voto em Lula

Comecei a ver hj pessoas que estão colocando em seus perfis de redes sociais algo como: "Meu nome é fulano e vou votar em Lula!". Algumas destas pessoas frequentam igrejas. O que eu gostaria de dizer a estas pessoas é:

O ditador da Nicarágua, apoiado por Lula, expulsou do país todas as freiras católicas. Elas foram deixadas na fronteira com a Costa Rica pra irem a pé para aquele país. Algumas destas freiras tinham mais de 70 anos;

O ditador mandou prender padres e bispos católicos. Há suspeitas de que um bispo já esteja morto. Assassinado na prisão;

O ditador amigo de Lula impediu que os fiéis entrassem nas igrejas;

Por último, o ditador proibiu que evangélicos fossem às ruas comemorar o Dia da Bíblia.

Então, se um refugiado nicaraguense cristão visitasse a igreja que vc frequenta, vc teria a coragem de olhar nos olhos dele e dizer que vota em alguém que apoiou e apoia tudo isso??? 🤔
